import React, { Component } from 'react';
import Title from "./Title";

export default class Order extends Component {
    render() {
        return (
                            <div className="container">
                                <Title name="Order" title="Details" />
                                <div className="row justify-content-center">
								<div className=' form col-lg-5 col-md-8 col-sm-10 col-10 '>
									<div name='register'>
										<div className='form-group'>
											<label htmlFor='exampleInputEmail1'>Name:</label>
											<input
												type='text'
												name='name'
												className='form-control'
												id='name'
												aria-describedby='nameHelp'
												placeholder='Enter name'
												required ></input>
										</div>
										<div className='form-group'>
											<label htmlFor='exampleInputEmail1'>Address:</label>
											<input
												type='email'
												name='email'
												className='form-control'
												id='email'
												aria-describedby='emailHelp'
												placeholder='Enter Address'
												required ></input>
										</div>

										<div className='form-group'>
											<label htmlFor='exampleInputEmail1'>Phone:</label>
											<input
												type='text'
												name='phone'
												className='form-control'
												id='phone'
												aria-describedby='emailHelp'
												placeholder='Enter Phone Number'
												required ></input>
										</div>
										<div className='form-group'>
											<label htmlFor='exampleInputEmail1'>Landmark:</label>
											<input
												type='text'
												name='password'
												id='password'
												className='form-control'
												aria-describedby='emailHelp'
												placeholder='Enter Landmark'
												required ></input>
										</div>
										<div className='form-group'>
											<label htmlFor='exampleInputEmail1'>If Refferal Code:</label>
											<input
												type='text'
												className='form-control'
												placeholder='Enter Code' ></input>
										</div>
										</div>
									</div>
								</div>
                             </div>
        )
    }
}


